// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;
contract Vote{
    address maker;
    struct candidate{
        string name;
        uint id;
        uint votes;
    }
    struct voter{
        address account;//Account Number of the voter
        uint number;//will count what is the sequential number of the perticular voter
        bool enq;//Enquire if the voter has already voted so that he/she cannot vote multiple times
        uint chk;//Will check if the voter is registaring (him/her)self twice or more and latter it will check if the voter is registered at all to vote
    }
    constructor(){
        maker=msg.sender;
    }
    mapping(uint=>candidate) public Candidate;
    mapping(address=>voter) public Voter;
    //Function to add candidate
    uint number=0;
    function add_can(string memory _name) public {
        require(maker==msg.sender);//Only the maker of the contract will be able to add Candidates
        Candidate[number]=candidate(_name,number,0);
        number++;
    }
    //Function to see a candidate
    function see_can(uint _id) public view returns(string memory,uint,uint){
        return (Candidate[_id].name,Candidate[_id].id,Candidate[_id].votes);
    }
    //Function to add voter
    uint num=0;
    function add_voter(address _account) public{
        if(num>0){
        require(Voter[_account].chk==0);//Checing if the voter has registered before
        num++;
        Voter[_account]=voter(_account,num,false,1);
        }
        else{
        num++;
        Voter[_account]=voter(_account,num,false,1);
        }
    }
    //Function to view voter
    function see_voter(address _add) public view returns(voter memory){
        return Voter[_add];
    }
    //Function to vote
    function voting_candidate(address _acc,uint _id) public{
        require(Voter[_acc].enq==false);//This will confirm the voter votes only once
        require(_id<=number);//This will check that the voter is not voting a real candidate
        require(Voter[_acc].chk==1);//Check if the voter is at all registered
        Candidate[_id].votes++;
        Voter[_acc].enq=true;
    }
    //Function that will compare votes and determine the id of winner
    uint k=0;
    uint win_id;
    uint xy=Candidate[k].votes;
    function vote_counter() public returns(uint){
        for(k=0;k<=number;k++){
            if(xy>Candidate[k].votes){
            win_id=k;
            }
        }
        return win_id;
    }
    //View the winner
    function winner() public view returns(candidate memory){
        return Candidate[win_id];
    }
}
